  false,\n\t\"url\": null,\n\t\"notes\": \"In 2010 the village of Fagamalo, Tutuila,
  American Samoa, designated a no-take Marine Protected Area that sees the protection
  of 2.25 square kilometers of ocean. Because little is known regarding the status
  of living marine communities in the area, and at the request of the American Samoa
  Department of Marine and Wildlife Resources, NOAA scientists conducted surveys to
  assess the status of the benthic communities and establish a baseline against which
  to compare temporal change.nnThe data described here were collected via belt transect
  surveys of coral demography (adult and juvenile corals) by the NOAA Coral Reef Ecosystem
  Program (CREP) according to protocols established by the NOAA National Coral Reef
  Monitoring Plan (NCRMP). In 2015 data were collected at 18 stratified randomly selected
  sites. These data include photoquadrat benthic images. Data can be accessed online
  via the NOAA National Centers for Environmental Information (NCEI) Ocean Archive,
  accession #0146681. These photos have been analyzed for benthic cover (documented
  separately). Data from coral demographic surveys, including 1) an assessment of
  coral colony density and size-class distribution, 2) an assessment of coral recruitment,
  and 3) an evaluation of coral colony mortality, disease, and bleaching, were also
  collected for the selected monitoring sites and are also documented separately by
  CREP.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
